import React from "react";
import { useState } from "react";
import "./Styles/News.css";

function News() {
    const [data, setData] = useState([]);
    fetch("https://olxev9.deta.dev/vesti")
        .then((response) => response.json())
        .then((data) => {
            setData(data);
        });
    return <div className="news">News</div>;
}

export default News;
